import React, { createContext, useState } from "react";

const App = () => {
    const[num, setNum] =  useState(0);

    return(
         <button onClick={(() => {
            setNum(num +1);
         }, 
         () => {
            alert("I am clicked");
         })
         }
         >
            Click Me{num}
         </button>

    );
}

export default App;
